INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24001, 401, 2, 10046, 0.0, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 102301, "アヤネ", 0.0, 24, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24002, 402, 2, 10046, 2.21, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 102301, "アヤネ", 0.0, 24, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24003, 403, 2, 10046, 0.0, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 102301, "アヤネ", 0.0, 24, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24004, 701, 1, 10046, 1.99, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 192201, "アサヒ", 0.0, 24, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24005, 702, 2, 10046, 2.21, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192201, "アサヒ", 0.0, 24, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24006, 703, 1, 10046, 3.33, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 192201, "アサヒ", 0.0, 24, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24007, 801, 2, 10046, 0.0, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 192301, "部員３", 0.0, 24, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24008, 802, 2, 10046, 2.68, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192301, "部員３", 0.0, 24, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24009, 803, 2, 10046, 0.0, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 192301, "部員３", 0.0, 24, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24010, 501, 1, 10046, 0.0, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192501, "", 0.0, 24, "やった！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24011, 502, 1, 10046, 0.0, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192501, "", 0.0, 24, "勝ったよ！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24012, 503, 1, 10046, 0.0, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192501, "", 0.0, 24, "いい調子！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24013, 111, 2, 10046, 5.33, "2030/12/17 14:59:59", 6, "2020/07/31 12:00:00", 113501, "ミサト", 0.0, 24, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24014, 112, 2, 10046, 6.85, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 113501, "ミサト", 0.0, 24, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24015, 113, 2, 10046, 3.0, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 113501, "ミサト", 0.0, 24, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24016, 611, 2, 10046, 6.11, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192401, "ダイチ", 0.0, 24, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24017, 612, 2, 10046, 6.75, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192401, "ダイチ", 0.0, 24, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24018, 613, 2, 10046, 0.0, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 192401, "ダイチ", 0.0, 24, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24019, 211, 1, 10046, 4.52, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 113401, "ハツネ", 0.0, 24, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24020, 212, 1, 10046, 3.89, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 113401, "ハツネ", 0.0, 24, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24021, 213, 2, 10046, 13.49, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 113401, "ハツネ", 0.0, 24, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24022, 311, 2, 10046, 3.17, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 106501, "カヤ", 0.0, 24, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24023, 312, 2, 10046, 4.42, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 106501, "カヤ", 0.0, 24, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24024, 313, 1, 10046, 2.89, "2030/12/17 14:59:59", 6, "2020/07/31 12:00:00", 106501, "カヤ", 0.0, 24, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24025, 421, 3, 10046, 3.71, "2030/12/17 14:59:59", 4, "2020/07/31 12:00:00", 102301, "アヤネ", 0.0, 24, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24026, 721, 1, 10046, 5.1, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 192201, "アサヒ", 0.0, 24, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24027, 821, 3, 10046, 4.34, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192301, "部員３", 0.0, 24, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24028, 521, 1, 10046, 0.0, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 192501, "", 0.0, 24, "いい勝負だったよ\nまたやろうね", 0.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24029, 101, 2, 10046, 5.62, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 113501, "ミサト", 0.0, 24, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", -360.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24030, 102, 2, 10046, 9.58, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 113501, "ミサト", 0.0, 24, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", -360.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24031, 103, 2, 10046, 0.0, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 113501, "ミサト", 0.0, 24, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", -360.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24032, 104, 1, 10046, 9.13, "2030/12/17 14:59:59", 2, "2020/07/31 12:00:00", 113501, "ミサト", 0.0, 24, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", -360.0);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (24033, 105, 2, 10046, 8.27, "2030/12/17 14:59:59", 1, "2020/07/31 12:00:00", 113501, "ミサト", 0.0, 24, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", -360.0);
